<script>
    window.onload = function () {
        //5s自动返回 或 点击返回
        var oTime=document.getElementById("second");
        var i=5;
        function backWin(){
            window.history.go(-1);
        }
        function autoBackWin(){
            i--;
            oTime.innerHTML=i;
            if(i==1){
